import React,{useState} from "react";


export function Cards ({data}){

    console.log(data)
    let id = 4

    const returning = data.filter((x)=>x.id==id).map((card,index)=>{
        return (
            <div key ={index}>
                <div>
                    Card {index+1} of {data.length}
                </div>
                <div>
                    {card.front}
                </div>
            </div>
        )
    })
    return returning
    return 2
}
